BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `users` (
	`userid`	INTEGER,
	`name`	TEXT,
	PRIMARY KEY(`userid`)
);
CREATE TABLE IF NOT EXISTS `tags` (
	`userid`	INTEGER NOT NULL,
	`movieid`	INTEGER NOT NULL,
	`tagid`	INTEGER NOT NULL,
	`timestamp`	BIGINT,
	FOREIGN KEY(`movieid`) REFERENCES `movies`(`movieid`),
	PRIMARY KEY(`userid`,`movieid`,`tagid`),
	FOREIGN KEY(`tagid`) REFERENCES `taginfo`(`tagid`),
	FOREIGN KEY(`userid`) REFERENCES `users`(`userid`)
);
CREATE TABLE IF NOT EXISTS `taginfo` (
	`tagid`	INTEGER NOT NULL,
	`content`	TEXT NOT NULL,
	PRIMARY KEY(`tagid`)
);
CREATE TABLE IF NOT EXISTS `ratings` (
	`userid`	INTEGER NOT NULL,
	`movieid`	INTEGER NOT NULL,
	`rating`	NUMERIC NOT NULL,
	`timestamp`	BIGINT NOT NULL,
	CONSTRAINT `rating` CHECK(rating>=0ANDrating<=5),
	FOREIGN KEY(`movieid`) REFERENCES `movies`(`movieid`),
	PRIMARY KEY(`userid`,`movieid`),
	FOREIGN KEY(`userid`) REFERENCES `users`(`userid`)
);
CREATE TABLE IF NOT EXISTS `query4` (
	`movieid`	INT,
	`title`	TEXT
);
CREATE TABLE IF NOT EXISTS `query3` (
	`movies.title`	TEXT,
	`countofratings`	TEXT
);
CREATE TABLE IF NOT EXISTS `query2` (
	`name`	TEXT,
	`ratings`	TEXT
);
CREATE TABLE IF NOT EXISTS `query1` (
	`name`	TEXT,
	`moviecount`	TEXT
);
CREATE TABLE IF NOT EXISTS `movies` (
	`movieid`	INTEGER,
	`title`	TEXT,
	PRIMARY KEY(`movieid`)
);
CREATE TABLE IF NOT EXISTS `hasagenre` (
	`movieid`	INTEGER NOT NULL,
	`genreid`	INTEGER NOT NULL,
	FOREIGN KEY(`genreid`) REFERENCES `genres`(`genreid`),
	PRIMARY KEY(`movieid`,`genreid`),
	FOREIGN KEY(`movieid`) REFERENCES `movies`(`movieid`)
);
CREATE TABLE IF NOT EXISTS `genres` (
	`genreid`	INTEGER NOT NULL,
	`name`	TEXT NOT NULL,
	PRIMARY KEY(`genreid`)
);
COMMIT;
